            parent[x] = find(parent[x])
        return parent[x]

    def union(x, y):
        root_x = find(x)
        root_y = find(y)
        if root_x == root_y:
            return
        if rank[root_x] < rank[root_y]:
            root_x, root_y = root_y, root_x
        parent[root_y] = root_x
        if rank[root_x] == rank[root_y]:
            rank[root_x] += 1

    mst = []
    pq = [(weights[i], i) for i in range(n)]
    heapq.heapify(pq)

    while pq:
        weight, u = heapq.heappop(pq)
        if find(u) not in mst:
            mst.append([u, find(u), weight])
            union(u, find(u))

    return mst

