import heapq

def prim_mst(graph):
    n = len(graph)
    visited = [False] * n
    mst_weight = 0
    min_heap = [(0, 0)]  # (weight, vertex)

    while min_heap:
        weight, vertex = heapq.heappop(min_heap)
        if visited[vertex]:
            continue
        visited[vertex] = True
        mst_weight += weight

        for neighbor, weight in graph[vertex]:
            if not visited[neighbor]:
                heapq.heappush(min_heap, (weight, neighbor))

    return mst_weight

